import React from "react";
import {
  Nav,
  Navbar,
  Button,
  Container,
  Row,
  Card,
  Col,
} from "react-bootstrap";

function Home() {
  {
    /* TODO:styling for the button */
  }
  return (
    <Container>
      <div className="featured-list-row">
        <div className="featured-list-item">
          <Card style={{ width: "10rem" }}>
            <Card.Img variant="top" src="/logo.png" height="160px" />
            <Card.Body>
              <div className="featured-list-title-tag">
                <div>
                  <Card.Title>Card Title</Card.Title>
                </div>
                <Card.Title>$7</Card.Title>
              </div>

              <Card.Text>hello bitch</Card.Text>
              <Button variant="primary">Go somewhere</Button>
            </Card.Body>
          </Card>
        </div>
      </div>
    </Container>
  );
}

export default Home;
